  false,\n\t\"url\": null,\n\t\"notes\": \"The aquatic management plan for Rocky Mountain
  Arsenal National Wildlife Refuge (Refuge) provides management direction and guidance
  to ensure the conservation of fishery and other aquatic resources and habitat. This
  plan is in accordance with U.S. Fish and Wildlife Service (Service) directives and
  policies for the protection and preservation of fish habitat and health on refuges,
  as well as the goals and objectives outlined in the Comprehensive Management Plan
  (CMP). The CMP requires the Service maintain and enhance aquatic resources, while
  providing a venue for recreational fishing to the public. In 2005, the Service conducted
  an intense aquatic survey of Lake Mary, Ladora and Lower Derby as well as First
  Creek and Parkfield Wetlands. Survey parameters included water quality testing,
  invertebrate sampling, fish health assessments and composition. The results are
  the basis for management based decisions listed within this plan.\",\n\t\"owner_org\":
